import React from "react";
import { Redirect } from "react-router";
//import Shipment from "../Shipment/Shipment";
import axios from "axios";
import Header from "./Header";
import Menu from "./Menu";
import Items from "./Items";
import Shipment from "./Shipment";
//import AddButton from "../Buttons/AddButton/AddButton";
//import "./Main.css";
//import LogOut from "../LogOut/LogOut";
//import { IoIosAddCircleOutline } from "react-icons/io";
//import clearInputs from "../Modules/clearModule/Clear";
//import openClose from "../Modules/openClose/openClose";
//import newId from "../Modules/newId/newId";
class Main extends React.Component {
  render() {
    const { props } = this;

    if (!props.isLoggedIn) {
      return <Redirect to="/login" />;
    }
    console.log(props);
    return (
      <>
        <Header props={props} />
        <Menu
          listOfShipments={this.state.shipments.map(shipment => (
            <Shipment
              shipment={shipment}
              id={shipment.id}
              name={shipment.name}
              removeShipmentFromState={this.removeShipmentFromState}
              key={shipment.id}
              listOfItems={"1"}
            />
          ))}
        />
      </>
    );
  }
}

export default Main;
